social_posts.post_text:
Don't stop me now! ... Honestly I feel like I haven't stopped for a second in 2022 😅
I did 46 photo shoots over the last year (most of them were more like productions) and this is while working a full-time job. Photography is just my side gig but it's my love and obsession so big thanks to all of you out there in IG land for all the love and feedback ❤️✌️ it really helps motivate me to get out and create.
.
I've worked with so many wonderfully talented and creative people again this year. A lot of the concepts you see on my feed are ideas that they've come up with and I've helped bring to life. 
Thank you for the opportunity to work with you all! 🙌❤️
.
